import React from 'react'

export const TodoElement = ({todo, removeFromList}) => {
  const handleRemoveElement = () =>{
      removeFromList(todo.id)
  }
  return (
    <div>
        <input type ={'checkbox'}/>
        <h1>{todo.title}</h1>
        <input onClick={(e) => handleRemoveElement()} type={'button'} value ={'Remove'}></input>
    </div>
  )
}
